import React, { useEffect, useState } from 'react';
import './HosClaim.css'; // Import CSS for styling

const HosClaim = () => {
  const [claims, setClaims] = useState([]);
  const [expandedClaimId, setExpandedClaimId] = useState(null);

  useEffect(() => {
    const fetchClaims = async () => {
      const email = localStorage.getItem('userEmail'); // Retrieve email from local storage
      if (email) {
        const response = await fetch(`http://localhost:8090/claim/user/${email}`);
        console.log(response);
        if (response.ok) {
          const data = await response.json();
          // Filter out claims that are 'Not Submitted'
          const notSubmittedClaims = data.filter(claim => claim.status === 'Not Submitted');
          // Sort the claims by claim ID in ascending order
          const sortedData = notSubmittedClaims.sort((a, b) => a.id - b.id);
          setClaims(sortedData); // Store the sorted array of not submitted claims
        } else if (response.status === 404) {
          alert("Sorry, no records found");
          window.location.href = '/customerdash';
        } else {
          console.error('Failed to fetch claims:', response.statusText);
        }
      } else {
        console.error('User email not found in local storage');
      }
    };
    fetchClaims();
  }, []);

  const handleExpand = (id) => {
    setExpandedClaimId(expandedClaimId === id ? null : id);
  };

  const handleUpdateClick = (claimId) => {
    setExpandedClaimId(claimId);
  };

  const handleFormSubmit = async (claimData) => {
    try {
      const response = await fetch('http://localhost:8090/claim/submit', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(claimData),
      });

      if (response.ok) {
        alert('Claim submitted successfully!');
        window.location.href = '/user';
      } else {
        alert('Failed to submit the claim. Please try again.');
      }
    } catch (error) {
      alert('An error occurred. Please try again.');
      console.error('Error:', error);
    }
  };

  return (
    <div className='claim-containery'>
      {expandedClaimId === null ? (
        <div className='claim-list-4'>
          <table>
            <thead>
              <tr>
                <th>Claim ID</th>
                <th>Email</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {claims.map((claim) => (
                <tr key={claim.id} onClick={() => handleUpdateClick(claim.id)} style={{ cursor: 'pointer' }}>
                  <td>{claim.id}</td>
                  <td>{claim.userEmail}</td>
                  <td>
                    <button onClick={() => handleUpdateClick(claim.id)}>Update Details</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      ) : (
        <ClaimForm
          claim={claims.find((claim) => claim.id === expandedClaimId)}
          onSubmit={handleFormSubmit}
        />
      )}
    </div>
  );
};

const ClaimForm = ({ claim, onSubmit }) => {
  const [policyName, setPolicyName] = useState('');
  const [amountClaimed, setAmountClaimed] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    const claimData = {
      userEmail: claim.userEmail,
      policyName,
      amountClaimed,
    };
    onSubmit(claimData);
  };

  return (
    <div className="claim-form-containery">
      <form className="claim-form-4" onSubmit={handleSubmit}>
        <h2>Update Claim Details</h2>
        <input
          type="email"
          placeholder="Email"
          value={claim.userEmail}
          disabled
          required
        />
        <input
          type="text"
          placeholder="Policy Number"
          value={policyName}
          onChange={(e) => setPolicyName(e.target.value)}
          required
        />
        <input
          type="number"
          placeholder="Amount Claimed"
          value={amountClaimed}
          onChange={(e) => setAmountClaimed(e.target.value)}
          required
        />
        <button type="submit">Submit Claim</button>
      </form>
    </div>
  );
};

export default HosClaim;
